import React from "react";
import { Icon } from "semantic-ui-react";

const Footer = () => (
  <footer>
    <div class="links">
      <a>
        <Icon value="github">Git</Icon>
      </a>
      <a>
        <Icon value="linkedin square">In</Icon>
      </a>
      <a>
        <Icon value="stack overflow">SO</Icon>
      </a>
    </div>
  </footer>
);
export default Footer;
